// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "./UBIBeneficiary.sol";
import "./UBIReconciliationAccount.sol";
import "./IUBIBeneficiaryFactory.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract UBIBeneficiaryFactory is IUBIBeneficiaryFactory, Ownable {
    /**
     * @notice Create a new UBI Beneficiary contract
     *
     * @param _cUSDToken  Address of the cUSD token contract
     * @param _cUBIAuthToken Address of the cUBIAuth token contract
     * @param _userId UserId of the new beneficiary
     *
     */
    function createUBIBeneficiary(
        IERC20 _cUSDToken,
        ERC20PresetMinterPauser _cUBIAuthToken,
        string memory _userId
    ) external override returns (address) {
        UBIBeneficiary newAccount = new UBIBeneficiary(_cUSDToken, _cUBIAuthToken, _userId);
        newAccount.transferOwner(msg.sender);
        emit UBIBeneficiaryCreated(address(newAccount));
        return address(newAccount);
    }

    /**
     * @notice Create a new UBI Reconciliation Account
     *
     * @param _cUSDToken  Address of the cUSD token contract
     * @param _cUBIAuthToken Address of the cUBIAuth token contract
     * @param _custodian Address of the reconciliation custodian account
     *
     */
    function createUBIReconciliationAccount(
        IERC20 _cUSDToken,
        ERC20PresetMinterPauser _cUBIAuthToken,
        address _custodian
    ) external override returns (address) {
        UBIReconciliationAccount newAccount =
            new UBIReconciliationAccount(_cUSDToken, _cUBIAuthToken, _custodian);
        newAccount.transferOwner(msg.sender);
        emit UBIReconciliationAccountCreated(address(newAccount));
        return address(newAccount);
    }
}

